import React, {Component} from 'react';
import { Link } from 'react-router-dom';

class Navbar extends Component{
    render(){
        return (
            <div>
                <nav class="navbar navbar-expand-lg navbar-light bg-light">
                    <div class="collapse navbar-collapse" id="navbarNav">
                        <ul className="navbar-nav">
                        <li  className="nav-item"><Link to="/logout"><i className="fa fa-users">
                        </i>Logout</Link></li>
                        <br />
                        <li className="nav-item"><Link to="/create_album"><i className="fa fa-users">
                        </i>CreateAlbum</Link></li>
                        <li className="nav-item"><Link to="/edit_profile"><i className="fa fa-users">
                        </i>EditProfile</Link></li>
                        <li className="nav-item"><Link to="/dashboard"><i className="fa fa-users">
                        </i>Dashboard</Link></li>
                        <li className="nav-item"><Link to="/ViewAlbums"><i className="fa fa-users">
                        </i>View Albums</Link></li>
                    </ul>
                    </div>
                </nav>
            </div>
        )
    }
}

export default Navbar;
